export const initialState = {
    book: [],
    filter: null,
  };

  // Selector
  export const getBasketTotal = (book) => 
    book?.reduce((amount, item) => item.price + amount, 0);

  const reducer = (state, action) => {
    console.log(action);
    switch (action.type) {
      default:
        return state;
    }
  };

  export default reducer;
